  max-width: 300px;
`

class Content extends Component {
  render() {
    return (
      <Wrapper>
        <Title>Title</Title>
        <Duration>2018</Duration>
        <Detail>eieieieiei</Detail>
      </Wrapper>
    )
  }
}

export default Content
